import "./style.css";

import DefaulterIcon from "../../../assets/defaulter.svg";
import ExpandedIcon from "../../../assets/expanded.svg";

export default function Card({ status, data }) {
  return (
    <div className="clients card-container">
      <div className="card-title">
        <div className="card-icon">
            <img
              src={status === "defaulter" ? DefaulterIcon : ExpandedIcon}
              alt="Icon"
              className="icon"
            />
            <h1>
              {status === "defaulter" ? "Clientes Inadimplentes" : "Clientes em dia"}
            </h1>
        </div>
        <p className={status === "defaulter" ? "client-count red" : "client-count green"}>
          {data.length}
        </p>
      </div>
      <div className="table-container">
        <div className="table-head">
          <strong className="table-column first-column">
            Clientes
          </strong>
          <strong className="table-column mid-column">
            ID do clie.
          </strong>
          <strong className="table-column last-columns">
            Valor
          </strong>
        </div>
        <div className="table-body">
          {data.map((item) => {
            return (
              <div className="table-row" key={item.name}>
                <span className="table-column first-column">{item.name}</span>
                <span className="table-column mid-columns">
                  item.clientID
                </span>
                <span className="table-column last-columns">
                  R$ {item.value}
                </span>
              </div>
            );
          })}
        </div>
        <div className="card-bottom">
          <h2>Ver todos</h2>
        </div>
      </div>
    </div>
  );
}
